private synchronized ExtendedBlock popNextSuspectBlock() {
  Iterator<ExtendedBlock> iter = suspectBlocks.iterator();
  if (!iter.hasNext()) {
    return null;
  }
  ExtendedBlock block = iter.next();
  iter.remove();
  return block;
}
